import React, {Component} from 'react';
import { Link } from 'react-router-dom';

class Items extends Component {
    render() {
        const {item} = this.props
        const {types} = this.props
        if(types != []){
            types.map((type) => {
                return (
                    <div>
                       $ type
                    </div>
            )
            })}else{
        return (
                <Link to={`/item/${item.name}`} className='items-card' >
                    <img src={item.img}/>
                </Link>
        )}
    }


}

export {Items}
